const ENDIANNESS = (() => {
  const buffer = new ArrayBuffer(2);
  new DataView(buffer).setInt16(0, 256, true);
  // Int16Array uses the platform's endianness.
  return new Int16Array(buffer)[0] === 256 ? 'LE' : 'BE';
})();

